import React from "react";
import { Box, Center, Flex, Checkbox, Stack } from "@chakra-ui/react";

const Quiz = () => {
    return (
        <Box w="100%" p="20px">
            <Center h="100%">
                <Flex w="70%" direction="column">
                    <Box>This is message 1</Box>

                    <Stack></Stack>
                    <Checkbox colorScheme="red" defaultIsChecked>
                        Checkbox
                    </Checkbox>
                    <Checkbox colorScheme="green" defaultIsChecked>
                        Checkbox
                    </Checkbox>
                </Flex>
            </Center>
        </Box>
    );
};

export default Quiz;
